"use strict";(self.webpackChunkdocs=self.webpackChunkdocs||[]).push([[9858],{54976:e=>{e.exports=JSON.parse('{"title":"Application Services","description":"You can significantly extend the functionality of your Tembo Postgres instance by running tools and software built by the Postgres open source community. Application services run on dedicated compute resources and are managed by Tembo Cloud. Tembo runs on Kubernetes, which means all Application Services are run in their own Pods, and is important if you want to isolate their compute from your Postgres database. These applications come configured with defaults that let you get up and running quickly, but you can change the configurations at will.","slug":"/category/application-services","permalink":"/docs/category/application-services","navigation":{"previous":{"title":"Getting Started","permalink":"/docs/tembo-cloud/getting_started"},"next":{"title":"graphQL","permalink":"/docs/tembo-cloud/application-services/GRAPHQL"}}}')}}]);